core::sync::atomic::AtomicBool::store.doc:
Stores a value into the bool.

`store` takes an [`Ordering`] argument which describes the memory ordering
of this operation. Possible values are [`SeqCst`], [`Release`] and [`Relaxed`].

# Panics

Panics if `order` is [`Acquire`] or [`AcqRel`].

# Examples

```
use std::sync::atomic::{AtomicBool, Ordering};

let some_bool = AtomicBool::new(true);

some_bool.store(false, Ordering::Relaxed);
assert_eq!(some_bool.load(Ordering::Relaxed), false);
```

core::mem::take.doc:
Replaces `dest` with the default value of `T`, returning the previous `dest` value.

* If you want to replace the values of two variables, see [`swap`].
* If you want to replace with a passed value instead of the default value, see [`replace`].

# Examples

A simple example:

```
use std::mem;

let mut v: Vec<i32> = vec![1, 2];

let old_v = mem::take(&mut v);
assert_eq!(vec![1, 2], old_v);
assert!(v.is_empty());
```

`take` allows taking ownership of a struct field by replacing it with an "empty" value.
Without `take` you can run into issues like these:

```compile_fail,E0507
struct Buffer<T> { buf: Vec<T> }

impl<T> Buffer<T> {
    fn get_and_reset(&mut self) -> Vec<T> {
        // error: cannot move out of dereference of `&mut`-pointer
        let buf = self.buf;
        self.buf = Vec::new();
        buf
    }
}
```

Note that `T` does not necessarily implement [`Clone`], so it can't even clone and reset
`self.buf`. But `take` can be used to disassociate the original value of `self.buf` from
`self`, allowing it to be returned:

```
use std::mem;

# struct Buffer<T> { buf: Vec<T> }
impl<T> Buffer<T> {
    fn get_and_reset(&mut self) -> Vec<T> {
        mem::take(&mut self.buf)
    }
}

let mut buffer = Buffer { buf: vec![0, 1] };
assert_eq!(buffer.buf.len(), 2);

assert_eq!(buffer.get_and_reset(), vec![0, 1]);
assert_eq!(buffer.buf.len(), 0);
```

core::iter::IntoIterator::into_iter.doc:
Creates an iterator from a value.

See the [module-level documentation] for more.

[module-level documentation]: crate::iter

# Examples

```
let v = [1, 2, 3];
let mut iter = v.into_iter();

assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());
assert_eq!(None, iter.next());
```

core::iter::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

